string ver_reservadas(string id){
    if(id == "ATEH"){
        id = "ATEH";
    }else if(id == "DE"){
        id = "DE";
    }else if(id == "ENQUANTO"){
        id = "ENQUANTO";
    }else if(id == "ESCREVA"){
        id = "ESCREVA";
    }else if(id == "FIM"){
        id = "FIM";
    }else if(id == "FUNCAO"){
        id = "FUNCAO";
    }else if(id == "INICIO"){
        id = "INICIO";
    }else if(id == "INTEIRO" || id == "REAL"){
        id = "tipo";
    }else if(id == "NULO"){
        id = "nulo";    
    }else if(id == "LEIA"){
        id = "LEIA";
    }else if(id == "PARA"){
        id = "PARA";
    }else if(id == "PARE"){
        id = "PARE";
    }else if(id == "RECEBA"){
        id = "RECEBA";
    }else if(id == "SE"){
        id = "SE";
    }else if(id == "SENAO"){
        id = "SENAO";
    }else if(id == "VAR"){
        id = "VAR";
    }else if(id == "VET"){
        id = "VET";
    }else{
        id = "id";
    }
    return id;
}

int main(){
    char digito;
    string id = "";
    int estadoatual = 0;
    vector<string> entrada;
    while(scanf("%c", &digito)!= EOF){

        naoconsumido:
                                                                                  //label para quando um char no for consumido, reinicio antes de ler mais chars
        switch(estadoatual){

            case 0:       //caso o estado atual seja o zero
                if((digito >= 'a' && digito <= 'z')||(digito>='A'&&digito<='Z')){ //Se o digito lido for uma letra maiuscula ou minuscula comeco um id
                    id+=digito;                                                   //adiciono o digito na string identificao pra saber qual 
                    estadoatual=1;                                                //vai pro estado onde vou fazer a leitura dos caracteres seguintes se houverem
                }
                else if(digito>='0'&&digito<='9'){                                //Se o digito lido for um numero, comeco um numero
                    id+=digito;
                    estadoatual=2;
                }else if(digito=='<'){
                    estadoatual=4;
                    //vejo o proximo char no estado 4
                }else if(digito=='>'){
                    estadoatual=5;
                    //vejo o proximo char no estado 5
                }else if(digito=='*'){
                    estadoatual=6;
                    //vejo o proximo char no estado 6
                }else if(digito=='"'){
                    estadoatual=7;
                    //comeco uma string no estado 7
                }else if(digito=='.'||digito==':'||digito==';'||digito=='+'||digito=='-'||digito=='/'||digito=='%'||digito=='('||
                         digito==')'||digito=='['||digito==']'||digito=='&'||digito=='='||digito=='|'||digito=='!'){
                    //cria token
                    //consome e continua no estado 0
                    id+=digito;
                    entrada.push_back(id);
                    id="";
                }
                break;

            case 1:       //caso o estado atual seja 1, continuacao da leitura de id's
                if((digito >= 'a' && digito <= 'z')||(digito>='A'&&digito<='Z')||(digito>='0'&&digito<='9')){   //caso o digito seja outra letra ou numero, pode fazer parte da id
                        id+=digito;                                                                             //adiciono na string
                        //estadoatual = 1;                                                                      //estado continua 1
                }else{
                    //gera token IDENTIFICADOR
                    //recomeca sem consumir
                    //cout<<"cheguei na gereacao id"<<endl;
                    id = ver_reservadas(id);
                    entrada.push_back(id);
                    //cout<<id<<endl;
                    id="";
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 2:
                if((digito>='0'&&digito<='9')||digito==','){                                                   //caso o digito seja outro numero, pode fazer parte do numero
                    if (digito==','){
                        estadoatual = 3;
                    }
                    id+=digito;
                }else{
                    //gera token NUMEROINTEIRO
                    //recomeca sem consumir
                    entrada.push_back("num");
                    id="";
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 3:
                if(digito>='0'&&digito<='9'){         //se quero adicionar um nemero depois da virgula
                    id+=digito;
                    //estadoatual=3;

                }else{
                    //gero token NUMEROREAL
                    //recomeco sem consumir
                    entrada.push_back("num");
                    id="";
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 4:
                if(digito=='-'){
                    //gera token ATRIBUICAO
                    //consome e vai pro estado 0
                    entrada.push_back("<-");
                    estadoatual=0;
                }else if(digito=='>'){
                    //gera token DIFERENTE
                    //consome e vai pro estado 0
                    entrada.push_back("<>");
                    estadoatual=0;
                }else if(digito=='='){
                    //gera token MENORIGUAL
                    //consome e vai pro estado 0
                    entrada.push_back("<=");
                    estadoatual=0;
                }else{
                    //gera token MENORQUE
                    //recomeca com o mesmo digito pra ver aonde vai
                    entrada.push_back("<");
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 5:
                if(digito=='='){
                    //gera token MAIORIGUAL
                    //consome e vai pro estado 0
                    entrada.push_back(">=");
                    estadoatual=0;
                }else{
                    //gera token MAIORQUE
                    //recomeca com o mesmo digito pra ver aonde vai
                    entrada.push_back(">");
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 6:
                if(digito=='*'){
                    //gera token POTENCIA
                    //consome e vai pro estado 0
                    entrada.push_back("**");
                    estadoatual=0;
                }else{
                    //gera token MULTI
                    //recomeca com o mesmo digito pra ver aonde vai
                    entrada.push_back("*");
                    estadoatual=0;
                    goto naoconsumido;
                }
                break;

            case 7:
                if(digito == '"'){
                    //gero token da STRING
                    //cout<<id<<endl;
                    entrada.push_back("str");
                    id="";
                    estadoatual=0;
                }else{
                    id+=digito;
                    //estadoatual=7;
                }
                break;
            }
        }
    if(id != "")  entrada.push_back(id);
    entrada.push_back("$");
    /*
    for(int i = 0; i < entrada.size(); i++){
        if(i == 0) cout<<"-"<<entrada[i]; 
        else cout<<" "<<entrada[i];
    }
    //*/
    stack<string> pilha;
    vector<string> passos;
    pilha.push("0");
    int posicao = 0, aux2, estado;
    string aux = "", oqfazer = "", simbolo;
    bool erro = false, fazendo_red = false;

    while(posicao < entrada.size()){
        depois_reducao:
        string simbolo = entrada[posicao];

        se_reduzido:

        int simbolo_pos = -1;

        for(int i = 0; i < TAM_SIMBOLOS; i++){
            if(lista_simbolos[i] == simbolo){
                simbolo_pos = i;
                break;
            }
        }

        if(simbolo_pos == -1){
            erro = true;
            break;
        }

        aux = pilha.top();
        estadoatual = atoi(aux.c_str());                                    //pega estado atual do topo da pilha
        //cout<<"="<<aux<<"=";
        oqfazer = matriz[estadoatual][simbolo_pos];                 //pega oq fazer a partir da matriz


        if(oqfazer == " "){                                         //se vc tentou ler algo que nopode a partir do estado atual,  um erro
            //cout<<"posicao sem instrucao"<<estadoatual<<" "<<simbolo<<" "<<lista_simbolos[simbolo_pos]<<"|"<<oqfazer<<"|"<<simbolo_pos<<endl;
            erro = true;
            break;
        }else if(oqfazer == "acc"){                                 //se oq fazer for aceitar, vc aceita
            break;
        }else if(oqfazer[0]=='s'){                                  //se for para fazer um shift
            passos.push_back(oqfazer);
            oqfazer[0] = '0';
            aux2 = atoi(oqfazer.c_str());
            //cout<<"="<<oqfazer<<"=";                                 //pega o numero do estado para o qual deve mudar
            aux = to_string(aux2);
            pilha.push(lista_simbolos[simbolo_pos]);
            pilha.push(aux);                                       //adiciona simbolo e estado na pilha
        }else if(oqfazer[0]=='r'){
            passos.push_back(oqfazer);
            oqfazer[0] = '0';
            aux2 = atoi(oqfazer.c_str());
            //cout<<"="<<aux<<"=";
            simbolo = reduz[0][aux2];
            aux = reduz[1][aux2];
            int tira = atoi(aux.c_str());
            //cout<<"="<<aux<<"=";
            for(int i = 0; i < 2*tira; i++){
                pilha.pop();
            }

            goto se_reduzido;
        }else{
            passos.push_back("vaipara"+oqfazer);
            //proximo estado
            pilha.push(simbolo);
            pilha.push(oqfazer);
            goto depois_reducao;
        }
        posicao++;
    }

    if(erro){
        cout<<"NO\n";
    }else{
        cout<<"YES\n";
    }
    /*
    for(int i = 0; i < passos.size(); i++){
        cout<<"|"<<passos[i]<<"|";
    }
    */
}
